import React, { Component } from 'react'

class Filter extends Component {
    render() {
        return (
            <div className="categories">
                <h5>Category Filters</h5>
                {this.props.categories.map(category => <button>{category}</button>)}
            </div>
        )
    }
}

export default Filter
